('01f149dd-206a-4247-8b1c-8a1911bfa721', '6376d080-3ef6-44ce-97de-b9e81da8256a', 'ENM', 'Ethical Non Monogamy refers to relationship structures where individuals engage in multiple romantic or sexual relationships with the informed consent of all parties involved', 1, '2025-01-30 05:31:20', '2025-04-14 13:14:40'),
