('03bb1d0c-df3d-4606-9266-8036dc7861f2', 'd32c9c02-8bf9-43ff-b929-0f24db97fa3d', 'Group', 'Group desires typically revolve around a sense of belonging, shared goals, mutual support, and effective communication.', 1, '2025-01-31 10:59:09', '2025-04-14 13:14:40'),
('06223d7b-d4e2-48e1-bddb-374eecd1cbdd', 'ebc39e7b-5436-4dea-98cf-7abae905018d', 'Cuddling', 'Cuddling desires often center around the need for physical closeness, warmth, and emotional comfort.', 1, '2025-01-31 11:48:15', '2025-04-14 13:14:40'),
('078b07fb-195d-43db-9f19-da7d800d9f14', 'd32c9c02-8bf9-43ff-b929-0f24db97fa3d', 'MMMM', 'MMMM (Male-Male-Male-Male) desires often focus on deep camaraderie, trust, and shared experiences.', 1, '2025-01-31 11:37:11', '2025-04-14 13:14:40'),
('0d36824c-e9c3-4907-a276-3e3f4ac3fc54', 'ebc39e7b-5436-4dea-98cf-7abae905018d', 'Edging', 'Edging desires involve the practice of delaying or controlling orgasm to build heightened arousal and intensify eventual release.', 1, '2025-01-31 11:51:57', '2025-04-14 13:14:40'),
('0dadcd45-d619-4449-a0b2-32129090b1d1', 'ebc39e7b-5436-4dea-98cf-7abae905018d', 'Kissing', 'Kissing desires focus on the need for intimacy, affection, and connection through physical touch.', 1, '2025-01-31 11:58:20', '2025-04-14 13:14:40'),
('1762bd2e-15a0-4fc9-801f-98689fe10a42', '6376d080-3ef6-44ce-97de-b9e81da8256a', 'Relationship', 'A relationship is a connection or bond between two or more people  typically involving emotional social or physical interaction', 1, '2025-01-30 05:43:25', '2025-04-14 13:14:40'),
('1b2d95ac-4414-4797-a81d-67e1fc667e47', 'd32c9c02-8bf9-43ff-b929-0f24db97fa3d', 'Threeways', 'Threeway desires often center around mutual exploration, open communication, trust, and respect among all participants.', 1, '2025-01-31 11:03:45', '2025-04-14 13:14:40'),
('20df3bc5-d1ec-4afc-94ff-87e39a59df0e', 'fc8f81d0-1384-4ff0-bfbc-0ba122fd7931', 'for tea', 'it my first meet', 0, '2025-02-04 07:34:32', '2025-04-14 13:14:40'),
('2325feb4-1f39-41f1-a6d2-c8f73c2a3738', '6376d080-3ef6-44ce-97de-b9e81da8256a', 'Monogamy', 'Monogamy refers to a relationship structure in which two individuals commit exclusively to each other  both emotionally and sexually  typically with the expectation of long term partnership', 1, '2025-01-30 05:40:04', '2025-04-14 13:14:40'),
('2934987e-1aa0-48be-8155-4475d1aecdcd', 'd32c9c02-8bf9-43ff-b929-0f24db97fa3d', 'Meeting', 'my friend', 0, '2025-01-30 05:18:45', '2025-04-14 13:14:40'),
