INSERT INTO `tbl_report_reason` (`id`, `title`, `description`, `status`, `created`, `updated`) VALUES
('1e3f6f89-ea5e-4c5b-b489-c628f42578b7', 'Spam or solicitation', 'This report reason applies when a user sends unwanted promotional content, advertisements, or repetitive messages with the intent of soliciting money, services, or engagement outside the dating app.', 1, '2025-02-01 05:46:00', '2025-02-01 05:46:00'),
('326b8eed-7997-4f08-b0bb-46b548c42d9b', 'Catfishing or fake profile', 'This report reason applies when a user creates a deceptive or fraudulent profile by using false information, fake photos, or pretending to be someone they are not.', 1, '2025-02-01 05:47:00', '2025-02-01 05:47:00'),
('4e9d6dd5-4b9c-468e-a190-13f5f360f2b8', 'Ghosting after matching', 'This report reason would apply when a user disappears or stops responding after matching, but most dating apps do not consider ghosting a violation of their guidelines.', 1, '2025-02-01 05:51:00', '2025-02-01 07:35:00'),
('55ab82b6-9e53-48dd-b63e-3ba4f9eec0cf', 'Explicit or sexual content', 'This report reason applies when a user shares or sends sexually explicit, graphic, or inappropriate content that violates community guidelines.', 1, '2025-02-01 05:41:00', '2025-02-01 05:41:00'),
('6cc2cc71-8a5d-43c8-8030-d699930365dd', 'Hate speech or discrimination', 'This report reason applies when a user engages in speech or behavior that targets, degrades, or discriminates against individuals or groups based on protected characteristics.', 0, '2024-12-30 06:06:00', '2025-02-01 05:38:00'),
('75f6d2fe-b6e2-4d2a-a85e-7c7daaed1085', 'Offensive or vulgar language', 'This report reason applies when a user uses language that is rude, obscene, or offensive, making others feel uncomfortable or disrespected.', 1, '2025-02-01 05:44:00', '2025-02-01 05:44:00'),
('7ae009cc-fef3-48c7-8acb-a02fa17276ec', 'Personal reasons', 'This report reason applies when a user wants to report someone but does not feel that the situation fits any of the predefined categories.', 1, '2025-02-01 05:53:00', '2025-02-01 05:53:00'),
('8a4d8b81-38ec-4075-90ee-73c24624847a', 'Stalking or intimidation', 'This report reason applies when a user engages in persistent, unwanted attention or behavior that makes another person feel unsafe, pressured, or threatened.', 1, '2025-02-01 05:40:00', '2025-02-01 05:40:00'),
('8fb89087-d276-483d-aa15-3044f58880a3', 'Inappropriate photos or messages', 'This report reason applies when a user shares or sends content that is offensive, inappropriate, or violates community guidelines.', 1, '2025-02-01 05:43:00', '2025-02-01 05:43:00'),
('c5838c7d-6c6c-45b8-8ad8-b32060263c47', 'Harassment or bullying', 'This report reason applies when a user engages in behavior that is aggressive, harmful, or intended to intimidate, belittle, or pressure another user.', 1, '2025-02-01 05:02:00', '2025-02-01 05:02:00'),
('c585ad3b-a250-4afb-8fac-6103812b3a38', 'Threatening or violent behavior', 'This report reason applies when a user exhibits behavior that is aggressive, intimidating, or implies harm toward another person.', 1, '2025-02-01 05:36:00', '2025-02-01 05:36:00');
