INSERT INTO `tbl_user_preference` (`id`, `title`, `description`, `status`, `created`, `updated`) VALUES
('0301ff03-e7b1-449a-9330-4feead848ef0', 'Trans Woman', 'A trans woman is an individual who was assigned male at birth but identifies as female.', 1, '2025-01-29 13:01:17', '2025-01-29 13:01:17'),
('0a2cfcb7-5655-4dcd-9e37-952c6cfa1316', 'Pangender', 'Pangender is a gender identity where a person feels an alignment with all genders or experiences a gender that encompasses every gender.', 1, '2025-01-29 12:55:05', '2025-01-29 12:55:05'),
('1706b2d2-d623-42fd-bde7-642cf4609d7f', 'Gender Questioning', 'Gender questioning refers to the process of exploring and considering one\'s gender identity, often before arriving at a definitive label.', 1, '2025-01-29 12:51:57', '2025-01-29 12:51:57'),
('20376d75-d331-4fc4-8cd2-7a649945d86c', 'Gender Fluid', 'Genderfluid is a gender identity where a persons gender shifts over time between different identities, such as male, female, nonbinary, agender, or other genders.', 1, '2024-12-21 05:20:02', '2025-01-29 12:47:26'),
('38eff2bf-3b42-4dd5-b1a8-b21499cd94fc', 'Androgynous', 'Androgynous refers to a gender identity, gender expression, or aesthetic that blends or balances both masculine and feminine traits.', 1, '2024-12-30 06:07:43', '2025-01-29 12:43:56'),
('62421333-a085-40a1-a60f-e4dcc1c544ab', 'Agender', 'Agender is a gender identity characterized by a lack of gender or identifying as genderless, neutral, or beyond the concept of gender.', 1, '2025-01-16 04:39:18', '2025-01-29 12:42:33'),
('65ac97f4-ec17-45b7-bc96-9d091856a07c', 'Transfeminine', 'Transfeminine refers to individuals who were assigned male at birth but identify with a gender expression or identity that is more aligned with femininity.', 1, '2025-01-29 12:57:11', '2025-01-29 12:57:11'),
('70c66fda-b66a-4501-87b3-39ae124cdfc2', 'Trans Man', 'A trans man is an individual who was assigned female at birth but identifies as male. Trans men may choose to transition socially, medically, or legally to align their gender expression with their identity, though not all do.', 1, '2025-01-29 12:59:35', '2025-01-29 12:59:35'),
('72f7e93e-b58e-4b93-95ab-6172f0f6744f', 'Genderqueer', 'Genderqueer is a gender identity that falls outside the traditional binary of male and female. People who identify as genderqueer may feel that their gender is fluid, nonbinary, or a mix of genders.', 1, '2025-01-29 12:50:57', '2025-01-29 12:50:57'),
('73780839-abe7-4180-8a9b-b16ac6f24294', 'Transmasculine', 'Transmasculine refers to individuals who were assigned female at birth but identify with a gender expression or identity that is more aligned with masculinity.', 1, '2025-01-29 12:57:59', '2025-01-29 12:57:59'),
('753027be-13fc-42e4-945e-e4c424d04531', 'Non-binary', 'Non-binary is a gender identity that falls outside the traditional binary of male and female.', 1, '2025-01-29 12:52:54', '2025-01-29 12:52:54'),
('8012df25-1591-4c32-9fd3-1fe8b296b68a', 'Bigender', 'Bigender is a gender identity where a person experiences two distinct genders, either simultaneously or shifting between them.', 1, '2024-12-21 05:30:35', '2025-01-29 12:45:02'),
('8b42b953-9adf-43a5-97a2-a7feb359179c', 'Intersex', 'Intersex refers to individuals whose biological sex characteristics (such as chromosomes, hormones, or genitalia) do not fit typical definitions of male or female.', 1, '2024-12-21 05:19:05', '2025-01-29 12:48:57'),
('92fa7df5-1b29-49d2-a0e3-cd2e50397e76', 'Man+Man couple', 'A man + man couple is a romantic and/or marital partnership between two individuals who identify as men.', 1, '2025-01-29 12:41:45', '2025-01-29 12:41:45'),
('9606d904-c272-49f7-879d-2250c7ecc404', 'Trans Non-binary', 'Trans non-binary refers to individuals whose gender identity doesn\'t fit within the traditional categories of male or female, but who also don\'t identify with the gender they were assigned at birth.', 1, '2025-01-29 13:00:30', '2025-01-29 13:00:30'),
('a49bb237-2e3f-4158-a658-6f3a6dbeb227', 'Other', 'The term \"other\" is often used as a broad or catch-all category to describe identities that don\'t fit into traditional gender norms or categories, such as male or female.', 1, '2025-01-29 12:53:59', '2025-01-29 12:53:59'),
('bfb5b95e-3d41-4e68-ba15-6a201613d87d', 'Man+Woman couple', 'A man + woman couple is a romantic and/or marital partnership between a man and a woman.', 1, '2025-01-29 12:38:21', '2025-01-29 12:38:21'),
('cbc08e0a-1af1-4f8a-8ac1-f1c2a0401a9e', 'Gender Nonconforming', 'Gender nonconforming (GNC) refers to individuals whose gender expression does not align with traditional or societal expectations of masculinity or femininity.', 1, '2025-01-29 12:50:05', '2025-01-29 12:50:05'),
('ddcae76c-e082-47e4-b15a-19b08c42c13c', 'Trans person', 'A trans person is someone whose gender identity differs from the sex they were assigned at birth. This can include individuals who identify as male, female, both, neither, or somewhere in between.', 1, '2025-01-29 12:58:52', '2025-01-29 12:58:52'),
('e86e6dcb-24c1-4e43-8783-e91ed1cc8b65', 'this is the sample user preference', 'Sample', 1, '2025-05-23 10:47:18', '2025-05-23 10:47:55'),
('eaccf5ab-d288-427c-aa59-58355f555d28', 'woman', 'A woman is an adult human who typically identifies with femininity', 1, '2025-01-16 07:46:16', '2025-01-29 11:53:10'),
('f3ed1e8f-5692-4260-bcc8-a22992c349b6', 'Two-Spirit', 'Two-Spirit is a term used by some Indigenous cultures in North America to describe a person who embodies both masculine and feminine qualities.', 1, '2025-01-29 13:02:29', '2025-01-29 13:02:29'),
('f971443d-387e-4f51-b245-fcc24ed464bc', 'Man', 'A man is an adult human who typically identifies with masculinity', 1, '2025-01-16 11:20:21', '2025-01-29 11:51:14');
